import React from 'react';
import Carousel from './Carousel'
import ProfileCard from './ProfileCard'

class ProfileCardsCarousel extends Component {
    render() {
    return (
        <Carousel show={2}>
            <ProfileCard />
            <ProfileCard />
            <ProfileCard />
            <ProfileCard />
            <ProfileCard />
        </Carousel>
    )
    }
}

export default ProfileCardsCarousel;
